;; **
;;; ## Evolution
;; **

;; @@
(defn plot-lt-evolution [coll]
(let [curr (map :mean (lifetime coll t0 tmax :evolution))
       dat {:count curr
            :days (range (count curr))}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :days :count]]
         [:geom_line {:color "steelblue"}]
         [:xlab "Day"]
         [:ylab "Hours"]
         [:theme_bw]
         [:ggtitle (str "Average lifetime evolution of " (element-name coll))])]
      {:width 5 :height 5})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;hollow-canyon/plot-lt-evolution</span>","value":"#'hollow-canyon/plot-lt-evolution"}
